import React from 'react';
import Image from 'react-bootstrap/Image'
import me from './picture.JPG'
import './Picture.css'


class Pic extends React.Component {
  render() {
    return (
      <div className="picture">
        <Image src={me} alt="picture of me" fluid />
        <div className="intro">
          <h1 className="mb-0"><span>陈芳婷<br />Fangting Chen (陈芳婷)<br />Software Programmer</span></h1>
          <h2 className="mt-0 pt-0"><span>Fangting Chen<br />Software Programmer</span></h2>
        </div>
      </div>
    );

    }
}

export default Pic;
